import React from "react";
import '../styles/homePage.module.css'
import backgroundImage from '../image/image2.jpg'; 

import Slider from "../components/image-slider/slider.component";

const HomePage = () => {
    return (
        <div>
            <div classname="zone_green">cover</div>
            <div classname="zone_red">announcement</div>
            <div classname="zone_blue">Picture slides</div>
            <div classname="zone_yellow">Footer</div>
        </div>
    )

}


export default HomePage;
